import React from 'react';

const ExampleComponent = () => {
    return (
        <div className="p-4 bg-blue-500 text-white rounded">
            <h1 className="text-xl font-bold">Hello, this is an Example Component!</h1>
            <p>This component demonstrates a simple UI element using Tailwind CSS.</p>
        </div>
    );
};

export default ExampleComponent;
